const InputUsuario = () => {
    return (
        <div>
            <Label htmlFor="usuario">Usuario</Label>
        <Grupoinput>
        <Input type="text" placeholder="Usuario" id="usuario"/>
        <IconoValidacion icon={faCircleCheck}/>
        </Grupoinput>
              <LeyendaError>"tu mama es hermosa"</LeyendaError>
          </div>



    );
 }
 export default InputUsuario;
